  transform: translateX(-80px) translateY(10px) rotate(-30deg);
  opacity: 0;
}
.btn {
  outline: none;
  padding: 0;
  margin: 0;
  border: none;
  border-radius: 4px;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  overflow: hidden;
}
.act_btn {
  background: #1FD9DC;
  background: -webkit-linear-gradient(left, #1FD9DC, #4F8DEE);
  background: -o-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: -moz-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: linear-gradient(to right, #1FD9DC, #4F8DEE);
  color: #fff;
}
.act_btn:active {
  color: #3574FA;
  background: #fff;
}
.dis_btn {
  background: #EBEBEB;
  color: #A0ACC1;
  border: 1px solid #EBEBEB;
}
.empty_btn {
  background: #fff;
  color: #3574FA;
}
.empty_btn:active {
  color: #fff;
  background: #3574FA;
}
.res_btn {
  color: #14b25a;
  border: 1px solid #14b25a;
  background: #fff;
}
.res_btn:active {
  background: #14b25a;
  color: #fff;
}
.footer_btn {
  margin: 0 auto;
  bottom: 34px;
  font-size: 18px;
  height: 43px;
  color: #fff;
  outline: none;
  border-radius: 30px;
  border: none;
  box-sizing: border-box;
  background: -webkit-linear-gradient(left, #1FD9DC, #4F8DEE);
  background: -o-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: -moz-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: linear-gradient(to right, #1FD9DC, #4F8DEE);
}
.footer_btn:active {
  opacity: 0.8;
}
.page_most_wrap {
  position: relative;
  width: 100%;
  height: 100%;
}
* {
  margin: 0;
  padding: 0;
}
.basic_page_wrap {
  position: relative;
  width: 100%;
  top: 0;
  background: #f8f8f8;
  height: 100%;
  overflow-y: auto;
}
.datum_txt {
  height: 32px;
  line-height: 32px;
  font-size: 14px;
  color: #a6a6a6;
  padding: 0 12px;
}
.footer_btns {
  position: absolute;
  width: 100%;
  height: 60px;
  bottom: 0;
  left: 0;
  background: #fff;
  border-top: 1px solid #dedede;
}
.text_btn {
  font-size: 18px;
  line-height: 42px;
  height: 42px;
  position: absolute;
  overflow: hidden;
  color: #333;
  margin: 0;
  left: 5%;
  top: 8px;
}
.bottom_btn {
  position: absolute;
  border-radius: 30px !important;
  width: 90%;
  right: 5%;
  top: 8px;
  height: 44px;
  line-height: 42px;
  font-size: 18px;
  outline: none;
  padding: 0;
  margin: 0;
  border: none;
  border-radius: 4px;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  overflow: hidden;
  background: #1FD9DC;
  background: -webkit-linear-gradient(left, #1FD9DC, #4F8DEE);
  background: -o-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: -moz-linear-gradient(right, #1FD9DC, #4F8DEE);
  background: linear-gradient(to right, #1FD9DC, #4F8DEE);
  color: #fff;
}
.bottom_btn:active {
  color: #3574FA;
  background: #fff;
}
.disable_btn {
  background: #FFE49D !important;
  color: #868686;
}
.input_cls {
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  font-size: 14px;
  border: none;
  outline: none;
  margin: 0;
  padding: 0;
  -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
  text-align: left;
}
.p_cls {
  font-size: 14px;
  line-height: 14px;
  margin: 0;
  position: absolute;
  top: 52%;
  transform: translateY(-50%);
  left: 0;
  text-align: left;
}
.btn_footer_pane {
  position: absolute;
  width: 100%;
  height: 60px;
  bottom: 0;
  left: 0;
}
